description:
Der <i>Ecoluddit</i> ist ein Mordskerl. Wirklich. Fragen sie seine Eltern, oder fragen Sie jemanden von der Beatgruppe <i>wontorra</i>, für die er lange unter dem Namen <i>DJ Lebewesen</i>den Plattenvati spielte. Sehen Sie die vielen, winzigen Lachfalten unter seinen Augen und das jugendliche Schmunzeln um seinen Mund. Ja, der <i>Ecoluddit</i> ist ein Pfundskerl. Und ein Hans im Glück dazu. Er hat keine ansteckenden Krankheiten, saust mit der U-Bahn, einem Simson Kleinroller KR 51/2 N oder einem schwarzen Fahrrad durch Berlin, er raucht selten und spielt gern "Ich sehe was, was du nicht siehst...", er isst gut und trinkt am liebsten Malzbier. Der <i>Ecoluddit</i> ist zu all dem ein fröhlicher Entdecker. Er hat die Sinnlosigkeit seiner Existenz entdeckt. Und hören Sie seine Stücke "Ethik und Gewalt" und "Meine Teile - Deine Teile". Das ist doch keine Musik mehr. Jung, launisch &amp; schizoid. Und das ist sie auch selbst, <i>die alte Splatterfresse.</i> &#13;
